import React from 'react';
import { NavLink } from 'react-router-dom';

const Header = () => {
    return (<>
        <header>
            <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
                <NavLink exact to="/" className="navbar-brand"></NavLink>
            </nav>
        </header>
    </>)
}

export default Header;
